import React from 'react'

function About(props) {
    console.log("props",props);
    return (
        <div>
      <section id="welcome-section" className="welcome-section .white">
        <h1 >Hey I am Stephen Infanto </h1>
        <p key={i}>A web developer who loves to work with 
        {props.skills.map((tech,i)=>{
            return    { tech }
        })}  </p>
     </section>
        </div>
    )
}

export default About;
